import './App.css';
import './nav.js'
function App() {
  return (

    <body>
    <div id="navb" class="navb">
      <a href="https://m3.material.io/styles/icons/overview" id="colum1" class="colum"></a>
      <a href="https://m3.material.io/styles/icons/overview" id="colum2" class="colum" style="background-color: bisque;">
        <h3> &#160 &#160 &#160 ART</h3>
      </a>
      <a href="https://m3.material.io/styles/icons/overview " id="colum3" class="colum" style="background-color:rebeccapurple;"></a>
    </div>
    <button id="menubtn" class="custom-button">
      <i id="icon" class="bi-check-circle"></i>
    </button>
  </body>
  );
}

export default App;
